import { useState } from 'react';
import React from 'react';
// import back from '../photos/back.jpg';
import back from '../photos/back5.png';
import Loginpage from './loginpage';
import Signup from './signup';
import './homepage.css';
import { Link, useNavigate } from 'react-router-dom';

const styles = {
    BackGroundImage:{
    backgroundImage: `url(${back})`,
    position: 'absulut',
    height: '100%',
    width: '100%',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    position: 'absolute',
  },
  signupModalBtn:{
    position: 'absolute',
    top: '18%',
    left: '12%', 
  },
  signupPop:{
    position: 'absolute',
    top: '4%',
    left: '21%', 
  },
  title:{
    position: 'absolute',
    top: '28%',
    left: '21%', 
  },
  title2:{
    position: 'absolute',
    top: '40%',
    left: '20%', 
  },
  title3:{
    position: 'absolute',
    top: '53%',
    left: '14%',
    lineHeight: '2.5'
  },
  paragraph:{
    position: 'absolute',
    top: '70%',
    left: '19%', 
  },
  About:{
    position: 'absolute',
    top: '70%',
    left: '36%', 
  },
};


function Homepage() {
  const [openModal, setOpenModal] = useState(false);
  const [openSignUpModal, setopenSignUpModal] = useState(false);

  const navigate = useNavigate();
  
  const handleLoginButtonClick = () => {
    setOpenModal(true);
    setopenSignUpModal(false);
  }

  const handleSignupButtonClick = () => {
    setOpenModal(false);
    setopenSignUpModal(true);
  }
 
  return (
    <div>
      <div class="container">
        <div class="coast">
    <div class="wave-rel-wrap">
      <div class="wave"></div>
    </div>
  </div>
  <div class="coast delay">
    <div class="wave-rel-wrap">
      <div class="wave delay"></div>
    </div>
  </div>
  <div class="text text-w">w</div>
  <div class="text text-a">a</div>
  <div class="text text-v">v</div>
  <div class="text text-e">e</div>
</div>

    </div>
  );
}

export default Homepage;
